import React from 'react';
import { Link } from 'react-router-dom';
import { BsPersonFill } from 'react-icons/bs'; // Importer l'icône de Bootstrap
import { FiUser } from 'react-icons/fi'; // Importer l'icône de l'utilisateur
import CustomButton from '../Components/Button.jsx';
import TitleSubtitle from '../Components/TitleSubtitle.jsx';
import CopyrightText from '../Components/CopyrightText.jsx';

function LoginPage() {
  return (
    <div className="login-page">
      {/* Logo */}
      <div className="logo-container">
        <img className="logo" src="/logo.png" alt="Logo de l'application" />
      </div>

      {/* Formulaire de connexion */}
      <form className="login-form">
        <div className="form-group">
          <label htmlFor="username">Nom d'utilisateur</label>
          <div className="input-group">
            <span className="input-group-text">
              <BsPersonFill /> {/* Icône Bootstrap */}
            </span>
            <input
              type="text"
              className="form-control"
              id="username"
              placeholder="Entrez votre nom d'utilisateur"
            />
          </div>
        </div>
        <div className="form-group">
          <label htmlFor="password">Mot de passe</label>
          <input
            type="password"
            className="form-control"
            id="password"
            placeholder="Entrez votre mot de passe"
          />
        </div>
        <CustomButton variant="primary">Connexion</CustomButton>
      </form>

      {/* Lien vers la page d'inscription */}
      <Link to="/registration">Inscription</Link>

      {/* Composant pour le droit d'auteur */}
      <CopyrightText />
    </div>
  );
}

export default LoginPage;
